      Hint: ExtendedContent
      Value: |
        <p>Kaytee Exact Natural Cockatiel food is a premium extruded food and has been the recognized nutritional leader by avian nutritionists, veterinarians and breeders since its introduction over 25 years ago. Each nugget contains "exact nutrition" ensuring your bird gets exactly the right nutrition to produce better feathering, brighter colors and maintain excellent health. exact Rainbow is 100% consumable with no seed hulls or shells for less mess.<br /> <br /> Kaytee understands that sharing your life with a pet bird is not only enjoyable but very enriching. Kaytee shows our love by ensuring we provide your pet bird with the best nutrition for a long and healthy life. With over 150 years of avian nutritional experience, it's no wonder why Kaytee is at the heart of every healthy feeding routine.</p>
